import React, { useEffect, useState } from 'react'

function App() {

  const [backEndData, setBackEndData] = useState([{}])

  useEffect(() => {
    fetch("/api")
      .then(data => {setBackEndData(data)})
  }, [])

  return (
    <div>
      {backEndData.users.map((user, i) => {
        <p key={i}>{user}</p>
      })}

    </div>
  )
}

export default App
